import './App.css';
import { GroceryList } from './GroceryList';
import image1 from './man.jpg'
import image2 from './shopping.jpg'



function App() {
  return (
    <div className="App">
      <img src={image1} alt='man' width="250px"/>
      <h1>Grocery Grocery List</h1>
      <GroceryList/>
      <img src={image2} alt='shopping' width="250px"/>
    </div>
  );
}

export default App;
